import React from 'react';
import ReactDOM from 'react-dom';
import "./video.css";
import ReactPlayer from 'react-player';




class VideoHome extends React.Component{
  render(){
    return(
<div className='player-wrapper row'>
<ReactPlayer className='react-player '
  playing
  url={[
    {src: './video/V1-3.webm', type: 'video/webm controls'},
    {src: './video/V1-2.ogg', type: 'video/ogg controls'},
    {src: './video/V1-1.mp4', type: 'video/mp4 controls'}
  ]}
  width='100%'
  height='100%'
/>
</div>

  )}
};

export default VideoHome;
